"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Diuver (CZ, PL, RU);",
"     </li>",
"     <li>",
"      Dytor (IN);",
"     </li>",
"     <li>",
"      Setoram (KP);",
"     </li>",
"     <li>",
