var title_f28_13_28891="Stress echo v stress MPI";
var content_f28_13_28891=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F77242&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F77242&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Comparative advantages of stress echocardiography and stress radionuclide perfusion imaging in diagnosis of coronary heart disease",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Advantages of stress echocardiography",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1. Higher specificity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. Versatility - more extensive evaluation of cardiac anatomy and function",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. Greater convenience, efficacy, availability",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4. Lower cost",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Advantages of stress perfusion imaging",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1. Higher technical success rate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. Higher sensitivity - especially for single vessel coronary disease involving the left circumflex",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. Better accuracy in evaluating possible ischemia when multiple resting left ventricular wall motion abnormalities are present",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4. More extensive published data base - especially in evaluation of prognosis",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: ACC/AHA 2002 guideline update for the management of patients with chronic stable angina--summary article: a report of the American College of Cardiology/American Heart Association Task Force on Practice Guidelines (Committee on the Management of Patients With Chronic Stable Angina). Circulation 2003; 107:149. Copyright &copy; 2003 American College of Cardiology.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
