var title_f28_13_28894="In hospital mortality by gender";
var content_f28_13_28894=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F79678&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F79678&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 554px\">",
"   <div class=\"ttl\">",
"    In-hospital mortality after a myocardial infarction is higher for women than men",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 534px; height: 278px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Data from 384,878 men and women between the ages of 30 and 89 years entered into the National Registry of Myocardial Infarction show that the in-hospital mortality after a myocardial infarction is higher for women than men (16.7 versus 11.5 percent); however, the difference in mortality rates decreases in older patients and was no longer significant over the age of 74.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Vaccarino V, Parsons L, Every NR, et al. for the National Registry of Myocardial Infarction 2 Participants. N Engl J Med 1999; 341:217.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
